import React from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";

const Homepage = () => {
  const navigate = useNavigate();

  return (
    <div className="bg-gray-100 h-screen flex flex-col">
      <Navbar />
      <div className="flex flex-col items-center justify-center flex-grow">
        <h1 className="text-5xl font-bold text-blue-500 text-center">
          Welcome to BizBridge
        </h1>
        <p className="mt-4 text-lg text-gray-700 text-center max-w-lg">
          Digitalizing local businesses, one step at a time. Join us in our mission to empower small businesses with modern tools and insights.
        </p>
        <button
          className="mt-6 px-6 py-3 bg-blue-500 text-white rounded-lg hover:bg-blue-600 transition-all duration-200 shadow-md"
          onClick={() => navigate("/auth")}
        >
          Get Started
        </button>
      </div>
    </div>
  );
};

export default Homepage;
